import { Link} from 'react-router-dom';

const ProductCard = (props) => {
  return (
    <>
      <Link to={`/products/${props.products.id}`}>
        <img
          className="card__img"
          src={props.products.image}
          alt={`Foto de ${props.products.name}`}
          title={`Foto de ${props.products.name}`}
        />
        <p className="card__ranking">{props.products.sales_ranking}</p>
        <p className="card__id">{props.products.id}</p>
        <h4 className="card__name">{props.products.name}</h4>
        <p className="card__price">{props.products.price}â‚¬</p>
        <p className="card__size">{props.products.size_stockXS}</p>
        <p className="card__size">{props.products.size_stockS}</p>
        <p className="card__size">{props.products.size_stockM}</p>
        <p className="card__size">{props.products.size_stockL}</p>
        <p className="card__size">{props.products.size_stockXL}</p>
        <p className="card__size">{props.products.size_stockXXL}</p>
        <p className="card__rate"> {props.products.stockout_rate}%</p>
        <p className="card__coverage">
          Cobertura almacen {props.products.wh_coverage}
        </p>
      <button >See</button>

      </Link>
    </>
  );
};
export default ProductCard;
